  input: TEXT,F3XN,,"AFPAC recently discovered that due to an accounting error, AFPAC
    has reported that its 'cash-on-hand' is $1000 less than is actually in the AFPAC
    bank account.This error occurred because a check in the amount of $1000 for a
    candidate contribution was written on the AFPAC bank account.The check was written
    on September 24, 2004.  Shortly after the check was written, AFPAC decided not
    to make the contribution to the candidate.As such, the check was never submitted
    to the candidate and was voided.No contribution was reported because no contribution
    was ever made.Unfortunately, the check was not noted as voided on AFPAC's bank
    ledger.As a result, while the disbursements and the cash-on-hand reported were
    reconciled on the FEC 3X reports, AFPAC actually had $1000 more in its bank account
    than the cash-on-hand reported.This discrepancy was recently noted during a review
    of previous monthly reports.AFPAC account advisor, Mr. Will Wiquist, recommended
    that we electronically submit a letter and attach a memo to our July 20th report
    explaining the error and our good faith efforts to correct it.AFPAC is amending
    its 10/20/04 report to reflect closing cash-on-hand of $42,508.81 rather than
    $41,508.81 and the amendment will be reflected on subsequent reports.Therefore
    this report shows the correct amount of cash-on-hand."
